create VIEW [dbo].[vw_MassifGreenHouseVP]
AS
SELECT   dbo.MassifGreenHouseVP.ID, dbo.MassifGreenHouseVP.LandId, dbo.MassifGreenHouseVP.LandName, 
                dbo.MassifGreenHouseVP.CropsName, dbo.MassifGreenHouseVP.PlantingArea, 
                dbo.MassifGreenHouseVP.JobPopulation, dbo.MassifGreenHouseVP.TotalPopulation, 
                dbo.MassifGreenHouseVP.TotalOutput, dbo.MassifGreenHouseVP.TotaValue, dbo.MassifGreenHouseVP.SoilType, 
                dbo.MassifGreenHouseVP.WateringType, dbo.MassifGreenHouseVP.LandProperty, 
                dbo.MassifGreenHouseVP.CropOutput, dbo.MassifGreenHouseVP.LeaseYear, 
                dbo.MassifGreenHouseVP.LastYearOutput, dbo.MassifGreenHouseVP.CurrentYearOutput, 
                dbo.MassifGreenHouseVP.CropsSalesPrice, dbo.MassifGreenHouseVP.EnterTime, dbo.MassifGreenHouseVP.Creater, 
                dbo.MassifGreenHouseVP.CreatedTime, dbo.MassifGreenHouseVP.Modifier, dbo.MassifGreenHouseVP.ModifiedTime, 
                dbo.osc_region.parent_id, dbo.osc_region.citycode, dbo.osc_region.adcode, dbo.osc_region.[level], 
                dbo.osc_region.center
FROM      dbo.MassifGreenHouseVP LEFT OUTER JOIN
                dbo.osc_region ON dbo.MassifGreenHouseVP.LandId = dbo.osc_region.id
