CREATE VIEW [dbo].[vw_osc_region]
AS
SELECT  dbo.osc_region.id, dbo.osc_region.name, dbo.osc_region.parent_id, dbo.osc_region.citycode, dbo.osc_region.adcode, 
                   dbo.osc_region.center, dbo.osc_region.[level], dbo.region_gis.GPSLocations, dbo.MassifGreenHouseVP.LandId, 
                   dbo.MassifGreenHouseVP.LandName, dbo.MassifGreenHouseVP.CropsName, dbo.MassifGreenHouseVP.PlantingArea, 
                   dbo.MassifGreenHouseVP.JobPopulation, dbo.MassifGreenHouseVP.TotalPopulation, 
                   dbo.MassifGreenHouseVP.TotalOutput, dbo.MassifGreenHouseVP.TotaValue, dbo.MassifGreenHouseVP.SoilType, 
                   dbo.MassifGreenHouseVP.WateringType, dbo.MassifGreenHouseVP.LandProperty, dbo.MassifGreenHouseVP.LeaseYear, 
                   dbo.MassifGreenHouseVP.CropOutput, dbo.MassifGreenHouseVP.LastYearOutput, 
                   dbo.MassifGreenHouseVP.CurrentYearOutput, dbo.MassifGreenHouseVP.CropsSalesPrice, 
                   dbo.MassifGreenHouseVP.EnterTime, dbo.MassifGreenHouseVP.Creater, dbo.MassifGreenHouseVP.CreatedTime, 
                   dbo.MassifGreenHouseVP.Modifier, dbo.MassifGreenHouseVP.ModifiedTime, dbo.osc_region.IsRoot, 
                   dbo.region_gis.Color
FROM      dbo.MassifGreenHouseVP LEFT OUTER JOIN
                   dbo.osc_region ON dbo.MassifGreenHouseVP.LandId = dbo.osc_region.id LEFT OUTER JOIN
                   dbo.region_gis ON dbo.MassifGreenHouseVP.LandId = dbo.region_gis.landId
