/****** Object:  View [dbo].[vw_osc_region_group]    Script Date: 2023/6/30 10:08:44 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO

CREATE view [dbo].[vw_osc_region_group] as
select vg.id,
       vg.name,
	   vg.parent_id,
	   vg.citycode,
	   vg.adcode,
	   vg.center,
	   vg.level,
	   vg.GPSLocations,
	   vg.CropsName,
	   vg.SoilType,
	   vg.WateringType,
	   vg.LandProperty,
	   cast(sum(vg.PlantingArea) as decimal(18,2)) PlantingArea,
	   cast(sum(vg.LeaseYear) as decimal(18,2)) LeaseYear,
	   cast(sum(vg.CropOutput) as decimal(18,2)) CropOutput,
	   sum(cast(vg.LastYearOutput as decimal(18,2))) LastYearOutput,
	   cast(sum(vg.CurrentYearOutput) as decimal(18,2)) CurrentYearOutput,
	   cast(sum(vg.CropsSalesPrice) as decimal(18,2)) CropsSalesPrice,
	   cast(sum(vg.JobPopulation) as decimal(18,2)) JobPopulation,
	   cast(sum(vg.TotalPopulation) as decimal(18,2)) TotalPopulation,
	   cast(sum(vg.TotalOutput) as decimal(18,2)) TotalOutput,
	   cast(sum(vg.TotaValue) as decimal(18,2)) TotaValue
from vw_osc_region vg group by 
vg.id,
vg.name,
vg.parent_id,
vg.citycode,
vg.adcode,
vg.center,
vg.level,
vg.GPSLocations,
vg.CropsName,
vg.SoilType,
vg.WateringType,
vg.LandProperty
GO
