--添加数据存储过程
CREATE PROCEDURE [dbo].[AddMassifGreenHouseVP]
(
                  @ID bigint,--编号
                  @LandId int, --地块编号_1条地块对应多条数据
				  @LandName nvarchar(100),--地块名称
                  @CropsName nvarchar(16), --农作物名称
                  @PlantingArea decimal, --农作物的种植面积_单位亩
                  @JobPopulation int, --务工人口数量
                  @TotalPopulation int, --总人口数量
                  @TotalOutput decimal, --总产量
                  @TotaValue decimal, --总产值_农作物的总产值
                  @SoilType nvarchar(16), --土壤类型
                  @WateringType nvarchar(16), --灌溉类型
                  @LandProperty varchar(50), --土地属性_租赁或者购买
                  @LeaseYear int, --土地租赁年限
                  @CropOutput float, --同一作物种植年限
                  @LastYearOutput nvarchar(16), --上一年度作物产量
                  @CurrentYearOutput decimal, --本年度作物产量
                  @CropsSalesPrice decimal, --农作物售价_单位公斤
                  @EnterTime datetime, --录入时间_录入数据的时间_用户可编辑
                  @Creater nvarchar(16), --添加人
                  @CreatedTime datetime, --添加时间
                  @Modifier nvarchar(16), --修改人
                  @ModifiedTime datetime --修改时间
)
as
begin
     insert into MassifGreenHouseVP
     (
               [LandId],
			   [LandName],
               [CropsName],
               [PlantingArea],
               [JobPopulation],
               [TotalPopulation],
               [TotalOutput],
               [TotaValue],
               [SoilType],
               [WateringType],
               [LandProperty],
               [LeaseYear],
               [CropOutput],
               [LastYearOutput],
               [CurrentYearOutput],
               [CropsSalesPrice],
               [EnterTime],
               [Creater],
               [CreatedTime],
               [Modifier],
               [ModifiedTime]
     )
     values
     (
               @LandId,
			   @LandName,
               @CropsName,
               @PlantingArea,
               @JobPopulation,
               @TotalPopulation,
               @TotalOutput,
               @TotaValue,
               @SoilType,
               @WateringType,
               @LandProperty,
               @LeaseYear,
               @CropOutput,
               @LastYearOutput,
               @CurrentYearOutput,
               @CropsSalesPrice,
               @EnterTime,
               @Creater,
               @CreatedTime,
               @Modifier,
               @ModifiedTime
     );
     SELECT IDENT_CURRENT('MassifGreenHouseVP') AS ID;
end
