CREATE PROCEDURE [dbo].[GetMassifGreenHouseVPPage]
(
  @StartRow int, --开始位置
  @EndRow int, --结束位置
  @TotalNumber int out,--总数据量
  @SortField nvarchar(max),--排序字段
  @SortMethod nvarchar(10),--排序方法
  @SqlWhere nvarchar(max) --查询条件
)
as
BEGIN
	declare @SqlStr nvarchar(max),
    @totalsql nvarchar(max),
    @PageSql nvarchar(max),
    @TableName nvarchar(max);
    set @TableName='dbo.[MassifGreenHouseVP]';
    set @SqlStr='select 
                  Row_Number() over(order by '+@SortField+' '+@SortMethod+') as Row,';
                Set @SqlStr=@SqlStr+'[ID],'
                Set @SqlStr=@SqlStr+'[LandId],'
				Set @SqlStr=@SqlStr+'[LandName],'
                Set @SqlStr=@SqlStr+'[CropsName],'
                Set @SqlStr=@SqlStr+'[PlantingArea],'
                Set @SqlStr=@SqlStr+'[JobPopulation],'
