                Set @SqlStr=@SqlStr+'[SoilType],'
                Set @SqlStr=@SqlStr+'[WateringType],'
                Set @SqlStr=@SqlStr+'[LandProperty],'
                Set @SqlStr=@SqlStr+'[LeaseYear],'
                Set @SqlStr=@SqlStr+'[CropOutput],'
                Set @SqlStr=@SqlStr+'[LastYearOutput],'
                Set @SqlStr=@SqlStr+'[CurrentYearOutput],'
                Set @SqlStr=@SqlStr+'[CropsSalesPrice],'
                Set @SqlStr=@SqlStr+'[EnterTime],'
                Set @SqlStr=@SqlStr+'[Creater],'
                Set @SqlStr=@SqlStr+'[CreatedTime],'
                Set @SqlStr=@SqlStr+'[Modifier],'
                Set @SqlStr=@SqlStr+'[ModifiedTime]'
    Set @SqlStr=@SqlStr+' from '+@TableName;
    if @SqlWhere<>'' 
    Begin
       set @SqlStr=@SqlStr+' Where '+@SqlWhere;
    End
    set @totalsql='with Result as('+@SqlStr+')select @t=count(*) from Result';
    EXEC sp_executesql
        @totalsql, 
        N'@t AS INT OUTPUT',
        @t = @TotalNumber OUTPUT;
    set @PageSql='with Result as('+@SqlStr+')select * from Result where Row>='+cast(@StartRow as varchar)+' and Row<='+cast(@EndRow as varchar);
    print @PageSql;
    exec(@PageSql);	
END
